import React from 'react';
import PropTypes from 'prop-types';

class Login extends React.Component {
    render() {
        return (
            <div>Hello, world</div>
        );
    }
}

Login.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default Login;
